import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import {Dropdown} from 'react-bootstrap';


function myFunction() {
  var x = document.getElementById("myTopnav");
  if (x.className === "topnav") {
    x.className += " responsive";
  } else {
    x.className = "topnav";
  }
}

export class Navbar extends Component {
    render() {
      return (
      <nav>
          <ul>
            <li><Link to="/" class='link'>Home</Link></li>
            <li><Link to="/journal" class='link'>Journal</Link></li>
            <li><Link to="/selfcare" class='link'>Selfcare</Link></li>
            <Dropdown>
              <Dropdown.Toggle variant="success" id="dropdown-basic">
                Selfcare
              </Dropdown.Toggle>

              <Dropdown.Menu>
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
            <ul>
              <li><Link to="/mental" class='link'>Mental Selfcare</Link></li>
              <li><Link to="/physical" class='link'>Physical Selfcare</Link></li>
              <li><Link to="/practical" class='link'>Practical Selfcare</Link></li>
              <li><Link to="/social" class='link'>Social Selfcare</Link></li>
              <Link to="javascript:void(0);" class='link' class="icon" onclick="myFunction()">
                <i class="fa fa-bars"></i>
              </Link>
            </ul>
        </ul>
      </nav>
    );
    }
  }

  export default Navbar;
